import React from 'react'
import MovieList from './../Movies'


export default function Movies(){
    return(
        <>
        {
            MovieList.map((dataList) => {
               return(
                   <div>
                       <img 
                            src='./../img/himym.jpg'
                            className=''
                            alt=''
                        />
                        <h1 className='text-white z-50 relative top-0'>{dataList.title}</h1>
                   </div>

               )
           })
        }
        </>
    )
}
